INSERT INTO `Product` VALUES (21,'Менструальные прокладки MOPPIE HERBAL CARE органические, с профилактирующей полоской, 245мм, 3 капли, HC-254-3','HC-245-3','https://resources.cdn-kaspi.kz/img/m/p/p56/p26/47719669.jpg?format=gallery-small','Дневные прокладки для слабых / умеренных / средних месячных\n\n\n\nРазмер: 245 мм (3 капли).\n\n\n\nВ упаковке 8 прокладок\n\n\n\nАртикул: НС-245-3\n\n\n\nГигиенические женские прокладки из органического хлопка с профилактирующей травяной полоской HERBAL CARE. Почувствуйте лечебный эффект травяной полоски уже после первого применения.\n\n\n\nТонкие, по-настоящему \"дышащие\", не создают \"парниковый\" эффект и не вызывают раздражений, не провоцируют размножение бактерий, поддерживают естественный pH интимной зоны у подростков, девушек и женщин.\n\n\n\nКоллекция гипоаллергенных супертонких прокладок с удивительной вместимостью и важным преимуществом - уменьшением симптомов болезненных месячных (дисменореи), а также мгновенная впитываемость выделений, отсутствие неприятного запаха и идеально чистое бельё.\n\n\n\nБиоразлагаемый японский гидрогель Sumitomo Super Water Gel Absorbent Sap для прокладок за 20 секунд впитывает и надежно запечатывает выделения и нейтрализует запах.\n\n\n\nКрепкий гипоаллергенный клей не позволит прокладке \"съехать\" или собраться \"комком\".\n\n\n\nДля слабых, умеренных, средних месячных в дневное или ночное время.\n\n\n\nНаучно доказанный эффективный микс из трав традиционной китайской медицины обеспечивает целый спектр полезных свойств.\n\n\n\nДаже одно применение гигиенических прокладок HERBAL CARE приносит значительное улучшение как физического, так и психического состояния, связанного с менструальным циклом.\n\n\n\nПолынь горькая:\n\n\n\nУбирает неприятные запахи\n\n\n\nДягиль лекарственный:\n\n\n\nОбеспечивает антибактериальный эффект\n\n\n\nСыть круглая:\n\n\n\nОбладает противовоспалительными и антисептическими свойствами\n\n\n\nСостав:\n\n\n\n1-й слой: органический хлопок;\n\n\n\n2-й слой: Травяная полоска из китайских лечебных трав: дягиль, полынь, сыть круглая;\n\n\n\n3-й слой: бумага Airlaid;\n\n\n\n4-й слой:Sumitomo Super Water Gel Absorbent Sap ;\n\n\n\n5-й слой: бумага Airlaid;\n\n\n\n6-й слой: нижняя пленка;\n\n\n\n7-й слой: разделительная бумага;\n\n\n\n8-й слой: индивидуальная упаковка;\n\n\n\nПродукция прошла международную сертификацию: FDA,SGS, Intertek, GOTS, ISO 9001:2015\n\n\n\nИзготовлено без:\n\n\n\nсинтетического хлопка\n\n\n\nпестицидов\n\n\n\nотдушек\n\n\n\nхлорного отбеливания\n\n\n\nГМО\n\n\n\nискусственных красителей\n\n\n\nтоксичного клея\n\n\n\nацетона\n\n\n\nстирола\n\n\n\nхлороформа\n\n\n\nхлорметана\n\n\n\nхлорэтана и других токсичных ингредиентов.\n\n\n\nСпособ применения:\n\n\n\nСнять защитный слой, прикрепить к белью и разгладить пальцами.\n\n\n\nИспользовать однократно.\n\n\n\nСрок годности указан на упаковке.\n\n\n\nУказание по утилизации: не бросать в канализацию.',0,NULL,'2025-07-03 08:40:26.431','2025-07-03 08:40:26.431',35,2346,0,0,0,0,11,13,715,10,5),(22,'Ежедневные прокладки Moppie Organic Cotton, 155мм, POC-155-1','POC-155-1','https://resources.cdn-kaspi.kz/img/m/p/pda/pf2/47719396.jpg?format=gallery-small','Ежедневные прокладки\n\n\n\nРазмер: 155 мм (1 капля)\n\n\n\nВ упаковке 15 штук\n\n\n\nАртикул: РОС-155-1\n\n\n\nГигиенические прокладки MOPPIE из органического хлопка обладают естественной впитывающей способностью.\n\n\n\nПо-настоящему \"дышащие\", не создают \"парниковый\" эффект и не вызывают раздражений и поддерживают естественный pH интимной зоны у подростков, девушек и женщин.\n\n\n\nЕжедневки идеальны для использования днем - мгновенная впитываемость выделений, отсутствие неприятного запаха и чистое бельё.\n\n\n\nНадежный гипоаллергенный клей не позволит прокладке \"съехать\" или собраться \"комком\".\n\n\n\nКоллекция Premium Organic Cotton подойдет даже для очень чувствительного организма, склонного к аллергическим реакциям или раздражениям.\n\n\n\nОсобенно рекомендуется в случае:\n\n\n\n- Чувствительной и склонной к аллергии кожи;\n\n\n\n- Недавних родов;\n\n\n\n- Недавней гинекологической операции.\n\n\n\nСостав:\n\n\n\n1-й слой: органический хлопок;\n\n\n\n2-й слой: бумага Airlaid;\n\n\n\n3-й слой: PE нижняя пленка;\n\n\n\n4-й слой: разделительная бумага;\n\n\n\n5-й слой: индивидуальная упаковка;\n\n\n\nПродукция прошла международную сертификацию: FDA,SGS, Intertek, GOTS, ISO 9001:2015\n\n\n\nИзготовлено без:\n\n\n\nсинтетического хлопка\n\n\n\nпестицидов\n\n\n\nотдушек\n\n\n\nхлорного отбеливания\n\n\n\nГМО\n\n\n\nискусственных красителей\n\n\n\nтоксичного клея\n\n\n\nацетона\n\n\n\nстирола\n\n\n\nхлороформа\n\n\n\nхлорметана\n\n\n\nхлорэтана и других токсичных ингредиентов\n\n\n\nСпособ применения:\n\n\n\nСнять защитный слой, прикрепить к белью и разгладить пальцами.\n\n\n\nИспользовать однократно.\n\n\n\nСрок годности указан на упаковке.\n\n\n\nУказание по утилизации: не бросать в канализацию.\n\n',0,NULL,'2025-07-03 08:51:29.618','2025-07-03 08:51:29.618',35,1744,0,0,0,0,7,7,245,10,5),(23,'Менструальные прокладки Moppie Organic Cotton, супер длинные 42 см, 5 капель, POC-420-5','POC-420-5','https://resources.cdn-kaspi.kz/img/m/p/p96/p11/47718342.jpg?format=gallery-small','Ночные Гипер прокладки для обильных месячных, после родов или гинекологических операций.\n\n\n\nСупер длинные 420 мм (5 капель)\n\n\n\nВ упаковке 5 штук\n\n\n\nАртикул: РОС-420-5\n\n\n\nГигиенические прокладки MOPPIE из органического хлопка обладают естественной впитывающей способностью.\n\n\n\nТонкие, по-настоящему \"дышащие\", не создают \"парниковый\" эффект и не вызывают раздражений и поддерживают естественный pH интимной зоны у подростков, девушек и женщин.\n\n\n\nКоллекция гипоаллергенных супертонких прокладок с удивительной вместимостью и мгновенной впитываемостью выделений, отсутствие неприятного запаха и идеально чистое бельё.\n\n\n\nБиоразлагаемый японский гидрогель Sumitomo Super Water Gel Absorbent Sap для прокладок в течение 20 секунд впитывает и надежно запечатывает выделения и запах.\n\n\n\nКрепкий гипоаллергенный клей не позволит прокладке \"съехать\" или собраться \"комком\".\n\n\n\nКоллекция Premium Organic Cotton подойдет даже для очень чувствительного организма, склонного к аллергическим реакциям или раздражениям.\n\n\n\nПрокладки рекомендованы в родовой и после родовой периоды, после кесарева сечения, гинекологических или урологических операций, для интенсивных, обильных месячных в дневное или ночное время.\n\n\n\nСостав:\n\n\n\n1-й слой: органический хлопок;\n\n\n\n2-й слой: бумага Airlaid;\n\n\n\n3-й слой: Sumitomo Super Water Gel Absorbent Sap ;\n\n\n\n4-й слой: бумага Airlaid;\n\n\n\n5-й слой: PE нижняя пленка;\n\n\n\n6-й слой: разделительная бумага;\n\n\n\nПродукция прошла международную сертификацию: FDA,SGS, Intertek, GOTS, ISO 9001:2015\n\n\n\n \n\n\n\nИзготовлено без:\n\n\n\nсинтетического хлопка\n\n\n\nпестицидов\n\n\n\nотдушек\n\n\n\nхлорного отбеливания\n\n\n\nГМО\n\n\n\nискусственных красителей\n\n\n\nтоксичного клея\n\n\n\nацетона\n\n\n\nстирола\n\n\n\nхлороформа\n\n\n\nхлорметана\n\n\n\nхлорэтана и других токсичных ингредиентов.\n\n\n\nСпособ применения:\n\n\n\nСнять защитный слой, прикрепить к белью и разгладить пальцами.\n\n\n\nИспользовать однократно.\n\n\n\nСрок годности указан на упаковке.\n\n\n\nУказание по утилизации: не бросать в канализацию.',0,NULL,'2025-07-03 08:54:36.708','2025-07-03 08:54:36.708',35,2300,0,0,0,0,8,15,720,10,6),(24,'Moppie менструальные трусики M-L, МР-МL 2 шт','МР-МL','https://resources.cdn-kaspi.kz/img/m/p/p98/peb/47590383.jpg?format=gallery-small','Размер: S/M/L (подходит для окружности талии 70-100 см).\nВ упаковке 2 штуки\nАртикул: МР-МL\nОдноразовые менструальные трусики MOPPIE для подростков / девушек / женщин с защитой от протекания на 360 градусов. В дни и ночи обильных выделений или для особых ситуаций просто необходимо ультратонкое менструальное нижнее белье.\nСупер мягкие и гипоаллергенные, они подарят идеальное ощущение комфорта и уверенности.\nТрусики идеальны после родов, гинекологической или урологической операции или при обильной менструации.\nБиоразлагаемый японский гидрогель Sumitomo Super Water Gel Absorbent Sap в серединной части трусиков быстро впитывает, надежно запечатывает выделения и поглощает запах.\nОдноразовые трусики с идеальной анатомической формой, широкой резинкой, хорошо тянутся и не натирают кожу, не сползают во время сна.\nМатериал менструальных трусиков изготовлен из высококачественной органической хлопчатобумажной ткани, без применения отдушек, красителей и агрессивных химических веществ. Не вызывает аллергии. Плотно прилегает к телу благодаря эластичной и мягкой резинке вокруг трусиков.\nТрусики надеваются как обычное нижнее белье, а снять трусики просто: достаточно разорвать боковые швы. Трусики не шуршат, комфортны в носке, мягкие, напоминают нижнее белье!\nРекомендуется:\nПодросткам, особенно в первый год наступления обильных месячных\nПри обильных месячных днем или ночью\nВ родовой период и послеродовой период\nПосле урологических или гинекологических операций\nПосле кесарева сечения\nПри ослаблении мышц тазового дна\nВ дальних поездках\nДля занятия спортом в период месячных\nПродукция прошла международную сертификацию: FDA,SGS, Intertek, GOTS, ISO 9001:2015\nСостав трусиков:\nМягкий нетканый гипоаллергенный материал;\n360° Эластичный пояс;\nЯпонский гель Sumitomo Super Water Gel Absorbent Sap (суперабсорбент);\nКлей Henkel (безопасный, пищевой);\nДвойной слой защиты от протечек;\nДышащий мягкий гипоаллергенный материал;\nУказание по утилизации:\nНе бросать в канализацию.\nИзготовлено без:\nпестицидов\nотдушек\nхлорного отбеливания\nГМО\nискусственных красителей\nтоксичного клея\nацетона\nстирола\nхлороформа\nхлорметана\nхлорэтана и других токсичных ингредиентов',0,NULL,'2025-07-03 09:00:07.848','2025-07-03 09:00:07.848',35,2000,0,0,0,0,13,15,780,10,4),(25,'Менструальные прокладки MOPPIE HERBAL CARE, органические, с профилактирующей полоской, 285мм, 4 капли, HC-285-4','HC-285-4','https://resources.cdn-kaspi.kz/im